import React from "react"
import Axios from 'axios'
import {Route, Switch} from 'react-router-dom'
import {UserInfo, Menu, Main, AboutProducts} from '../components'
import './MainPage.css'

function MainPage() {

  const [products, setProducts] = React.useState([]);
  const [category, setCategory] = React.useState([]);

  React.useEffect(() => {
    Axios.get('http://localhost:3000/db.json').then(({data}) => {
      setProducts(data)
    })
  }, []);

  React.useEffect(() => {
    Axios.get('http://localhost:3000/food_fdc_id.json').then(({data}) => {
      setCategory(data)
      console.log(category)
    })
  }, []);

  var arr= []
  var temp=[];
  arr=arr.filter((x)=> {
    if (temp.indexOf(x.description) < 0) {
      temp.push(x.description);
      console.log(temp.indexOf())
      
      return true;
    } 
    return false;
  })

  var newarr = JSON.stringify(arr);

  return (
    <div className="main-block">
      <div className="left-block">
        {/*<UserInfo/>*/}
        <Menu
          onChange={(name) => alert(name)}
          items={
            [
              {
                label: 'О продуктах',
                path: '/about',
              }
            ]
          }/>
          <div>
            <h1><a href="http://esh.by">ESH.BY</a></h1>
            <span onClick={setCategory}>@2021 Все права защищены</span>
          </div>
      </div>
      <div className="right-block">
        <Switch>
          <Route path="/main">
            {newarr}
            <Main/>
          </Route>
          <Route path="/about">
            <AboutProducts items={products}/>
          </Route>
        </Switch>
      </div>
    </div>
  )
}

export default MainPage
